import React from "react";

import{Grid} from '@material-ui/core';
import VideoItem from "./videoItem";

 const VideoList = ({videos})=>{
     const listOfVideos = videos.map((video, id) => <VideoItem key={id}/>)
    return(
        listOfVideos
    )
}

export default VideoList
